import React, { useContext, useEffect, useState } from 'react'
import './Display.css'
import Table from 'react-bootstrap/Table';
import axios from 'axios';
import 'react-tooltip/dist/react-tooltip.css'
import { Tooltip } from 'react-tooltip'

import {FiEdit} from 'react-icons/fi'
import { IoTrashOutline } from "react-icons/io5";
const Display = () => {
    
    const [users, setUsers] = useState([])
    const getUsersData = async () => {
        const res = await axios.get("https://655997ee6981238d054cb7f1.mockapi.io/crud")
        const data = res.data
        setUsers(data)
        console.log(data)

    }

    useEffect(() => {
        getUsersData()

    }, [])


    return (
        <div className='display'>
             <Tooltip id='my-tooltip'/>
           
            <Table variant='dark' striped bordered hover>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Mobile</th>
                        <th>Address</th>
                        <th>Actions</th>

                    </tr>
                </thead>

                {
                    users.map((elem, id) => {
                        return <tbody key={id}>
                            <tr>
                                <td>{id+1}</td>
                                <td>{elem.name}</td>
                                <td>{elem.email}</td>
                                <td>{elem.mobile}</td>
                                <td>{elem.address}</td>                              
                                <td className='actions'><FiEdit className='edit-Icon' id data-tooltip-content="Edit"/> <IoTrashOutline className='delete-Icon' /></td>
                            </tr>


                        </tbody>
                    })
                }
            </Table>
        </div>
    )
}

export default Display
